-- Table structure for sys_macro
-- ----------------------------
DROP TABLE IF EXISTS `sys_macro`;
CREATE TABLE `sys_macro`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `parent_id` bigint(255) NULL DEFAULT NULL COMMENT '父级id',
  `name` varchar(50) CHARACTER SET gbk COLLATE gbk_chinese_ci NULL DEFAULT NULL COMMENT '名称',
  `value` varchar(2000) CHARACTER SET gbk COLLATE gbk_chinese_ci NULL DEFAULT NULL COMMENT '值',
  `status` tinyint(4) NULL DEFAULT 1 COMMENT '状态，0：隐藏   1：显示',
  `type` tinyint(20) NULL DEFAULT NULL COMMENT '类型,0:目录，1:参数配置',
  `order_num` int(11) NULL DEFAULT NULL COMMENT '排序',
  `remark` varchar(500) CHARACTER SET gbk COLLATE gbk_chinese_ci NULL DEFAULT NULL COMMENT '备注',
  `gmt_create` date NULL DEFAULT NULL COMMENT '创建时间',
  `gmt_modified` date NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = gbk COLLATE = gbk_chinese_ci COMMENT = '通用字典表' ROW_FORMAT = Compact;

